import React from 'react'
import { Link } from 'react-router-dom';
import ArrowForwardIcon from '@material-ui/icons/ArrowForward';
import Button from 'react-bootstrap/Button'
export default class AppHeading extends React.Component {
    render() {
        return (
            <div>
                <div style={{ backgroundColor: randomColor(), height: '30px', width: '30px', display: 'inline-block', marginRight: '10px' }}>
                </div>
                {this.props.publisherName}
                <Link to={this.props.to}><Button style={{ margin: '10px' }} variant="light" className="justify-content-end"><ArrowForwardIcon style={{ alignContent: 'end' }}></ArrowForwardIcon></Button></Link>
            </div>

        )
    }
}
